class Solution:
    def numberOfPowerfulInt(self, start: int, finish: int, limit: int, s: str) -> int:
        def is_powerful(x: int) -> bool:
            str_x = str(x)
            if not str_x.endswith(s):
                return False
            for digit in str_x:
                if int(digit) > limit:
                    return False
            return True

        count = 0
        for i in range(start, finish + 1):
            if is_powerful(i):
                count += 1
        return count
```

