from math import gcd
from functools import reduce
from typing import List

class Solution:
    def minimumArrayLength(self, nums: List[int]) -> int:
        def lcm(x, y):
            return x * y // gcd(x, y)

        nums = list(set(nums))
        nums.sort(reverse=True)

        while len(nums) > 1:
            nums = [reduce(lcm, nums)]
            if nums[0] == 1:
                break

        return len(nums)
```

