        nums.sort(reverse=True)
        n = len(nums)
        for i in range(1, n + 1):
            if (nums[0] - 1) // i >= nums[i - 1]:
                return i
        return n
```

This solution sorts the input array in descending order and then iterates over the possible lengths of the final array. For each length `i`, it checks if the largest number in the array can be reduced to a number less than or equal to the `i-th` largest number in the array by performing the given operation. If it can, it returns `i` as the minimum length. If it cannot find such a length, it returns the original length of the array.

```
from typing import List
import heapq

class Solution:
    def minimumArrayLength(self, nums: List[int]) -> int:
        nums = list(set(nums))  # remove duplicates
        nums.sort(reverse=True)  # sort in descending order
        heapq.heapify(nums)  # convert to heap

        while len(nums) > 1:
            a = heapq.heappop(nums)
            b = heapq.heappop(nums)
            if a > b:
                heapq.heappush(nums, a % b)

        return len(nums)
```

