class Solution:
    def minOperations(self, nums: List[int], k: int) -> int:
        n = len(nums)
        xor_all = 0
        for num in nums:
            xor_all ^= num
        if xor_all == k:
            return 0
        res = float('inf')
        for num in nums:
            temp = xor_all ^ num
            cnt = 0
            for i in range(30):
                if ((temp >> i) & 1) != ((k >> i) & 1):
                    cnt += 1
            res = min(res, cnt)
        return res
```

