class Solution:
    def minOperations(self, nums: List[int], k: int) -> int:
        xor = 0
        for num in nums:
            xor ^= num
        if xor == k:
            return 0
        res = float('inf')
        for num in nums:
            new_xor = xor ^ num
            cnt = 0
            while new_xor != k:
                cnt += 1
                diff = k ^ new_xor
                if diff & (diff - 1) == 0:
                    break
                new_xor ^= diff & -diff
            else:
                res = min(res, cnt)
        return res if res != float('inf') else -1
```

