class Solution:
    def minOrAfterOperations(self, nums: List[int], k: int) -> int:
        n = len(nums)
        res = nums[:]
        for _ in range(k):
            mx = 0
            for i in range(n - 1):
                res[i] &= res[i + 1]
                mx = max(mx, res[i])
            res = res[:-1]
            n -= 1
        return reduce(or_, res)
