class Solution:
    def minOrAfterOperations(self, nums: List[int], k: int) -> int:
        n = len(nums)
        res = nums[:]
        for _ in range(k):
            i = 0
            while i < n - 1:
                if res[i] & res[i + 1] < res[i]:
                    res[i] = res[i] & res[i + 1]
                    res.pop(i + 1)
                    n -= 1
