class Solution:
    def sumOfPowers(self, nums: List[int], k: int) -> int:
        MOD = 10**9 + 7
        n = len(nums)
        nums.sort()
        dp = [[0]*(k+1) for _ in range(n+1)]

        for i in range(1, n+1):
            dp[i][1] = sum(abs(nums[j]-nums[i-1]) for j in range(i-1))

        for i in range(2, k+1):
            for j in range(i, n+1):
                dp[j][i] = min((dp[j-1][i-1] + sum(abs(nums[j-1]-nums[m]) for m in range(j-1, j-i+1))) for _ in range(j-i+1))

        return dp[n][k] % MOD
```

