class Solution:
    def getSmallestString(self, s: str, k: int) -> str:
        n = len(s)
        res = list(s)
        for i in range(n):
            diff = min((ord(res[i]) - ord('a') + k) % 26, k)
            res[i] = chr((ord(res[i]) - ord('a') - diff) % 26 + ord('a'))
            k -= diff
        return ''.join(res)
```

