class Solution:
    def minimizeStringValue(self, s: str) -> str:
        res = []
        last_occurrence = {}
        for c in s:
            if c == '?':
                for i in range(26):
                    if chr(i + 97) not in last_occurrence:
                        res.append(chr(i + 97))
                        last_occurrence[chr(i + 97)] = len(res) - 1
                        break
            else:
                res.append(c)
                last_occurrence[c] = len(res) - 1
        return ''.join(res)
```

