class Solution:
    def shortestSubstrings(self, arr: List[str]) -> List[str]:
        def all_substrings(s: str) -> List[str]:
            return [s[i: j] for i in range(len(s)) for j in range(i + 1, len(s) + 1)]

        def is_unique(sub: str, arr: List[str]) -> bool:
            return sum(sub in s for s in arr) == 1

        res = []
        for s in arr:
            subs = sorted(all_substrings(s), key=lambda x: (len(x), x))
            for sub in subs:
                if is_unique(sub, arr):
                    res.append(sub)
                    break
            else:
                res.append("")
        return res
