class Solution:
    def minimumDeletions(self, word: str, k: int) -> int:
        freq = {}
        for char in word:
            if char in freq:
                freq[char] += 1
            else:
                freq[char] = 1

        freq_values = sorted(freq.values())
        res = len(word)
        left, right = 0, len(freq_values) - 1

        while left < right:
            if freq_values[right] - freq_values[left] <= k:
                res = min(res, len(word) - (right - left + 1) * freq_values[left])
                left += 1
            else:
                right -= 1

        return res
```

