class Solution:
    def minimumSubarrayLength(self, nums: List[int], k: int) -> int:
        n = len(nums)
        prefix_or = [0] * (n + 1)
        for i in range(n):
            prefix_or[i + 1] = prefix_or[i] | nums[i]

        res = float('inf')
        for i in range(n):
            for j in range(i, n):
                if prefix_or[j + 1] - prefix_or[i] >= k:
                    res = min(res, j - i + 1)

        return res if res != float('inf') else -1
```

