class Solution:
    def minimumOperationsToMakeKPeriodic(self, word: str, k: int) -> int:
        n = len(word)
        freq = [{} for _ in range(k)]
        for i in range(n):
            freq[i % k][word[i]] = freq[i % k].get(word[i], 0) + 1
        res = 0
        for f in freq:
            max_count = max(f.values())
            res += sum(f.values()) - max_count
        return res
