class Solution:
    def minAnagramLength(self, s: str) -> int:
        from collections import Counter
        n = len(s)
        counter = Counter(s)
        return (n + len(counter) - 1) // len(counter)
```

This solution works by counting the frequency of each character in the string `s` using the `Counter` class from the `collections` module. The minimum possible length of the string `t` is then calculated as the ceiling of the division of the length of `s` by the number of unique characters in `s`. This is because each anagram of `t` must contain at least one of each unique character, and the length of `t` must be a divisor of the length of `s`.

```
class Solution:
    def minAnagramLength(self, s: str) -> int:
        from collections import Counter
        n = len(s)
        counter = Counter(s)
        g = n
        for i in range(1, n // 2 + 1):
            if n % i == 0:
                temp = Counter()
                for j in range(i):
                    temp += Counter(s[j::i])
                if all(temp[c] % (n // i) == 0 for c in temp):
                    g = min(g, i)
        return g
```

