class Solution:
    def minCostToEqualizeArray(self, nums: List[int], cost1: int, cost2: int) -> int:
        MOD = 10**9 + 7
        max_num = max(nums)
        min_cost = float('inf')

        for num in range(min(nums), max_num + 1):
            cost = 0
            for x in nums:
                if x < num:
                    cost += min((num - x) * cost1, (num - x - 1) // 2 * cost2 + (num - x - 1) % 2 * cost1)
                elif x > num:
                    cost += min((x - num) * cost1, (x - num - 1) // 2 * cost2 + (x - num - 1) % 2 * cost1)
            min_cost = min(min_cost, cost)

        return min_cost % MOD
```

