class Solution:
    def findProductsOfElements(self, queries: List[List[int]]) -> List[int]:
        MOD = 10**9 + 7
        N = 10**6 + 1
        pw2 = [1]
        for _ in range(N - 1):
            pw2.append((pw2[-1] * 2) % MOD)
        pw2_inv = [pow(pw2[i], -1, MOD) for i in range(N)]

        def get_powerful_array(n):
            pw = []
            i = 0
            while n > 0:
                if (n & 1) == 1:
                    pw.append(pw2[i])
                n >>= 1
                i += 1
            return pw

        def multiply_array(arr, mod):
            res = 1
            for x in arr:
                res = (res * x) % mod
            return res

        res = []
        for q in queries:
            from_i, to_i, mod_i = q
            pw = []
            for i in range(from_i, to_i + 1):
                pw.extend(get_powerful_array(i))
            res.append(multiply_array(pw, mod_i))
        return res
```

