class Solution:
    def findProductsOfElements(self, queries: List[List[int]]) -> List[int]:
        MOD = 10**9 + 7
        N = 10**6 + 1
        pw2 = [1]
        for i in range(20):
            pw2.append(pw2[-1] * 2 % MOD)
        pw2_inv = [pow(x, MOD - 2, MOD) for x in pw2]
        big_nums = [1]
        for i in range(1, N):
            pw = []
            x = i
            for j in range(20):
                if x % 2 == 0:
                    pw.append(pw2[j])
                    x //= 2
                else:
                    break
            pw.sort()
            big_nums.extend(pw)
        res = []
        for q in queries:
            from_i, to_i, mod_i = q
            prod = 1
            for i in range(from_i, to_i + 1):
                pw = []
                x = big_nums[i]
                for j in range(20):
                    if x % pw2[j] == 0:
                        pw.append(pw2_inv[j])
                        x //= pw2[j]
                    else:
                        break
                pw.sort(reverse=True)
                prod = (prod * pw[0] % MOD) % mod_i
            res.append(prod)
        return res
```

