class Solution:
    def valueAfterKSeconds(self, n: int, k: int) -> int:
        MOD = 10**9 + 7
        C = [[1]*(n+1) for _ in range(k+1)]
        for i in range(1, k+1):
            for j in range(1, n+1):
                C[i][j] = (C[i-1][j-1] + C[i][j-1]) % MOD
        return C[k][n]
```

