class Solution:
    def minimumDifference(self, nums: List[int], k: int) -> int:
        n = len(nums)
        or_values = [0] * (n + 1)
        for i in range(n):
            or_values[i + 1] = or_values[i] | nums[i]

        res = float('inf')
        for i in range(n):
            for j in range(i, n):
                or_val = or_values[j + 1] & ((1 << 30) - 1) if i > 0 else or_values[j + 1]
                res = min(res, abs(k - or_val))

        return res
