                l, r = q[1], q[2]
                peak = 0
                for i in range(l, r + 1):
                    if left[i] > 0 and right[i] > 0:
                        peak += 1
                res.append(peak)
            else:
                i, val = q[1], q[2]
                if i > 0:
                    left[i - 1] = left[i] - (nums[i] > nums[i - 1]) + (val > nums[i - 1])
                if i < n - 1:
                    right[i + 1] = right[i] - (nums[i] > nums[i + 1]) + (val > nums[i + 1])
                nums[i] = val
        return res
