class Solution:
    def countOfPeaks(self, nums: List[int], queries: List[List[int]]) -> List[int]:
        n = len(nums)
        left = [0] * n
        right = [0] * n
        left[0] = right[n-1] = 1
        for i in range(1, n):
            left[i] = left[i-1] + (nums[i] > nums[i-1])
        for i in range(n-2, -1, -1):
            right[i] = right[i+1] + (nums[i] > nums[i+1])
        peaks = [0] * n
        for i in range(1, n-1):
            peaks[i] = (left[i-1] > 0) and (right[i+1] > 0) and (nums[i] > nums[i-1]) and (nums[i] > nums[i+1])
        res = []
        for query in queries:
            if query[0] == 1:
                l, r = query[1], query[2]
                res.append(sum(peaks[l:r+1]))
            else:
                i, val = query[1], query[2]
                if i > 0:
                    left[i] = left[i-1] + (val > nums[i-1])
                if i < n-1:
                    right[i] = right[i+1] + (val > nums[i+1])
                peaks[i] = (left[i-1] > 0) and (right[i+1] > 0) and (val > nums[i-1]) and (val > nums[i+1])
                nums[i] = val
        return res
