class Solution:
    def minimumArea(self, grid: List[List[int]]) -> int:
        m, n = len(grid), len(grid[0])
        rows, cols = set(), set()

        for i in range(m):
            for j in range(n):
                if grid[i][j] == 1:
                    rows.add(i)
                    cols.add(j)

        min_row, max_row = min(rows), max(rows)
        min_col, max_col = min(cols), max(cols)

        return (max_row - min_row + 1) * (max_col - min_col + 1)
```

