class Solution:
    def doesAliceWin(self, s: str) -> bool:
        vowels = 'aeiou'
        n = len(s)
        dp = [[False] * (n + 1) for _ in range(n + 1)]

        for length in range(1, n + 1):
            for i in range(n - length + 1):
                j = i + length
                vowel_count = sum(1 for c in s[i:j] if c in vowels)
                dp[i][j] = vowel_count % 2 == (length % 2)

        for i in range(n - 1, -1, -1):
            for j in range(i + 1, n + 1):
                dp[i][j] = dp[i][j] or not dp[i][j - 1] or not dp[i + 1][j]

        return dp[0][n]
```

