class Solution:
    def canReachCorner(self, xCorner: int, yCorner: int, circles: List[List[int]]) -> bool:
        def distance(x1, y1, x2, y2):
            return math.sqrt((x2 - x1) ** 2 + (y2 - y1) ** 2)

        def is_valid(x, y):
            for cx, cy, r in circles:
                if distance(x, y, cx, cy) <= r:
                    return False
            return True

        queue = [(0, 0)]
        visited = {(0, 0)}
        while queue:
            x, y = queue.pop(0)
            if x == xCorner and y == yCorner:
                return True
            for dx, dy in [(1, 0), (-1, 0), (0, 1), (0, -1)]:
                nx, ny = x + dx, y + dy
                if (0 <= nx <= xCorner and 0 <= ny <= yCorner and
                        (nx, ny) not in visited and is_valid(nx, ny)):
                    queue.append((nx, ny))
                    visited.add((nx, ny))
        return False
