            for dx, dy in directions:
                nx, ny = x + dx, y + dy
                if (0 <= nx <= xCorner) and (0 <= ny <= yCorner) and (nx, ny) not in visited and is_valid(nx, ny):
                    queue.append((nx, ny))
                    visited.add((nx, ny))

        return False
