        count = 0
        for i in range(m):
            for j in range(n):
                x, y = 0, 0
                for k in range(i, m):
                    for col in range(j, n):
                        if grid[k][col] == 'X':
                            x += 1
                        elif grid[k][col] == 'Y':
                            y += 1
                        if x == y and x > 0:
                            count += 1
        return count
