import heapq

class Solution:
    def obstaclesArray(self, obstacles: List[List[int]], k: int) -> List[int]:
        pq = []
        res = []
        for x, y in obstacles:
            dist = abs(x) + abs(y)
            heapq.heappush(pq, dist)
            if len(pq) > k:
                heapq.heappop(pq)
            if len(pq) < k:
                res.append(-1)
            else:
                res.append(pq[0])
        return res
