class Solution:
    def minNumberOfSeconds(self, mountainHeight: int, workerTimes: List[int]) -> int:
        def time_to_reduce_height(worker_time, height):
            total_time = 0
            for i in range(1, height + 1):
                total_time += worker_time * i
            return total_time

        worker_times = sorted(workerTimes)
        total_time = 0
        while mountainHeight > 0:
            max_time = 0
            for worker_time in worker_times:
                time = time_to_reduce_height(worker_time, min(mountainHeight, worker_time))
                max_time = max(max_time, time)
                mountainHeight -= min(mountainHeight, worker_time)
            total_time += max_time
        return total_time
