class Solution:
    def minChanges(self, nums: List[int], k: int) -> int:
        n = len(nums)
        left, right = 0, n - 1
        diff_count = {}
        for i in range(n // 2):
            diff = abs(nums[left] - nums[right])
            if diff not in diff_count:
                diff_count[diff] = 0
            diff_count[diff] += 1
            left += 1
            right -= 1
        max_count = max(diff_count.values())
        return n - max_count
```

