    def minFlips(self, grid: List[List[int]]) -> int:
        m, n = len(grid), len(grid[0])
        rows, cols = [0] * m, [0] * n

        for i in range(m):
            for j in range(n // 2):
                if grid[i][j] != grid[i][n - j - 1]:
                    rows[i] += 1

        for j in range(n):
            for i in range(m // 2):
                if grid[i][j] != grid[m - i - 1][j]:
                    cols[j] += 1

        res = float('inf')
        for i in range(m):
            res = min(res, rows[i] + sum(cols))
            for j in range(n):
                cols[j] += grid[i][j] - grid[m - i - 1][j]

        return res if res != float('inf') else 0
