class Solution:
    def countOfPairs(self, nums: List[int]) -> int:
        MOD = 10**9 + 7
        n = len(nums)
        res = 1
        dp = [[0]*51 for _ in range(n+1)]
        dp[0][0] = 1
        for i in range(n):
            for j in range(50, -1, -1):
                for k in range(j, -1, -1):
                    dp[i+1][k] = (dp[i+1][k] + dp[i][j]) % MOD
            res = (res * dp[i+1][nums[i]]) % MOD
        return res
```

