from math import ceil

class Solution:
    def countGoodIntegers(self, n: int, k: int) -> int:
        count = 0
        for digits in permutations(range(10), n):
            if digits[0] == 0:
                continue
            num = int(''.join(map(str, digits)))
            if num % k == 0:
                count += 1
            else:
                for i in range(ceil(n / 2)):
                    if digits[i] != digits[n - i - 1]:
                        break
                else:
                    count += 1
        return count
