            num = int(''.join(map(str, p)))
            if num % k == 0 and str(num) == str(num)[::-1]:
                count += 1
            else:
                for q in permutations(p):
                    num = int(''.join(map(str, q)))
                    if num % k == 0 and str(num) == str(num)[::-1]:
                        count += 1
                        break
        return count // factorial(n)
