from collections import deque
from typing import List

class Solution:
    def maxMoves(self, kx: int, ky: int, positions: List[List[int]]) -> int:
        directions = [(2, 1), (1, 2), (-1, 2), (-2, 1), (-2, -1), (-1, -2), (1, -2), (2, -1)]

        def bfs(x: int, y: int, target_x: int, target_y: int) -> int:
            queue = deque([(x, y, 0)])
            visited = {(x, y)}
            while queue:
                x, y, step = queue.popleft()
                if (x, y) == (target_x, target_y):
                    return step
                for dx, dy in directions:
                    nx, ny = x + dx, y + dy
                    if 0 <= nx < 50 and 0 <= ny < 50 and (nx, ny) not in visited:
                        queue.append((nx, ny, step + 1))
                        visited.add((nx, ny))
            return float('inf')

        def dfs(index: int, x: int, y: int, alice_turn: bool) -> int:
            if index == len(positions):
                return 0
            max_moves = float('-inf') if alice_turn else float('inf')
            for i in range(index, len(positions)):
                nx, ny = positions[i]
                moves = bfs(x, y, nx, ny)
                if alice_turn:
                    max_moves = max(max_moves, moves + dfs(i + 1, nx, ny, False))
                else:
                    max_moves = min(max_moves, moves + dfs(i + 1, nx, ny, True))
            return max_moves

        return dfs(0, kx, ky, True)
