class Solution:
    def maxMoves(self, kx: int, ky: int, positions: List[List[int]]) -> int:
        directions = [(2, 1), (1, 2), (-1, 2), (-2, 1), (-2, -1), (-1, -2), (1, -2), (2, -1)]

        def bfs(start, end):
            queue = deque([(start, 0)])
            visited = {start}
            while queue:
                (x, y), step = queue.popleft()
                if (x, y) == end:
                    return step
                for dx, dy in directions:
                    nx, ny = x + dx, y + dy
                    if (nx, ny) not in visited and 0 <= nx < 50 and 0 <= ny < 50:
                        queue.append(((nx, ny), step + 1))
                        visited.add((nx, ny))
            return float('inf')

        memo = {}
        def dp(i, pos):
            if i == len(positions):
                return 0
            if (i, pos) in memo:
                return memo[(i, pos)]
            res = float('-inf')
            for j in range(len(positions)):
                if j != pos:
                    step = bfs((kx, ky), tuple(positions[j]))
                    res = max(res, step + dp(i + 1, j))
            memo[(i, pos)] = res
            return res

        return dp(0, -1)
