class Solution:
    def maxScore(self, grid: List[List[int]]) -> int:
        m, n = len(grid), len(grid[0])
        dp = [[set() for _ in range(n)] for _ in range(m)]

        for i in range(m):
            for j in range(n):
                dp[i][j].add(grid[i][j])

        for i in range(m-2, -1, -1):
            for j in range(n):
                for k in range(n):
                    if j != k:
                        dp[i][j].update(dp[i+1][k])

        res = 0
        for i in range(n):
            res = max(res, max(dp[0][i]))

        return res
