class Solution:
    def validSubstringCount(self, word1: str, word2: str) -> int:
        count = 0
        for i in range(len(word1)):
            for j in range(i + len(word2), len(word1) + 1):
                substring = sorted(word1[i:j])
                if all(c <= substring.count(c) for c in word2):
                    count += 1
        return count
