class Solution:
    def maxValue(self, nums: List[int], k: int) -> int:
        n = len(nums)
        res = 0
        for i in range(1 << n):
            x, y = 0, 0
            for j in range(n):
                if (i >> j) & 1:
                    if j < n // 2:
                        x |= nums[j]
                    else:
                        y |= nums[j]
            if bin(i).count('1') == 2 * k:
                res = max(res, x ^ y)
        return res
```

