def count_divisible_by_one(x, n, m):
    return x // n + x // m - x // (n * m // math.gcd(n, m))

def find_kth_smallest(k, n, m):
    low, high = 1, 10**18
    while low < high:
        mid = (low + high) // 2
        if count_divisible_by_one(mid, n, m) < k:
            low = mid + 1
        else:
            high = mid
    return low

