from collections import defaultdict, deque
from typing import List, Tuple

def read_input() -> Tuple[int, int, List[Tuple[int, int, int, int, int, int]]]:
    N, M = map(int, input().split())
    trains = []
    for _ in range(M):
        l, d, k, c, A, B = map(int, input().split())
        trains.append((l, d, k, c, A, B))
    return N, M, trains

def solve(N: int, M: int, trains: List[Tuple[int, int, int, int, int, int]]) -> None:
    graph = defaultdict(list)
    for l, d, k, c, A, B in trains:
        for t in range(l, l + d * (k - 1) + 1, d):
            graph[A].append((t, c, B))

    dp = [-float('inf')] * (N + 1)
    dp[1] = 0
    queue = deque([1])
    while queue:
        x = queue.popleft()
        for t, c, y in graph[x]:
            if dp[x] + t + c > dp[y]:
                dp[y] = dp[x] + t + c
                queue.append(y)

    for i in range(1, N):
        if dp[i] == -float('inf'):
            print("Unreachable")
        else:
            print(dp[i])

if __name__ == "__main__":
    N, M, trains = read_input()
    solve(N, M, trains)
