    if not get_valid_moves(grid):
        if is_takahashi_turn:
            return -1 if get_score(grid, 1) > get_score(grid, -1) else 1
        else:
            return -1 if get_score(grid, 1) < get_score(grid, -1) else 1
    best_score = -float('inf') if is_takahashi_turn else float('inf')
    best_move = None
