import sys
from heapq import heapify, heappop
from collections import defaultdict

def read_input():
    N, M = map(int, sys.stdin.readline().split())
    edges = []
    parent = list(range(N + 1))
    rank = [0] * (N + 1)
    for _ in range(M):
        K, C = map(int, sys.stdin.readline().split())
        vertices = list(map(int, sys.stdin.readline().split()))
        for i in range(K):
            for j in range(i + 1, K):
                edges.append((C, vertices[i], vertices[j]))
    return N, edges, parent, rank

def find(parent, x):
    if parent[x] != x:
        parent[x] = find(parent, parent[x])
    return parent[x]

def union(parent, rank, x, y):
    x_root = find(parent, x)
    y_root = find(parent, y)
    if x_root != y_root:
        if rank[x_root] < rank[y_root]:
            parent[x_root] = y_root
        elif rank[x_root] > rank[y_root]:
            parent[y_root] = x_root
        else:
            parent[y_root] = x_root
            rank[x_root] += 1

def kruskal(N, edges, parent, rank):
    heapify(edges)
    mst_weight = 0
    connected_components = N
    while edges and connected_components > 1:
        weight, u, v = heappop(edges)
        if find(parent, u) != find(parent, v):
            union(parent, rank, u, v)
            mst_weight += weight
            connected_components -= 1
    if connected_components > 1:
        return -1
    return mst_weight

N, edges, parent, rank = read_input()
print(kruskal(N, edges, parent, rank))
