    visited = {tuple(S)}
    while queue:
        state, step = queue.popleft()
        if state == T:
            return step
        for i in range(N-1):
            if state[i] != '.' and state[i+1] != '.':
                new_state = state[:]
                new_state[i], new_state[i+1] = '.', '.'
                new_state[N], new_state[N+1] = state[i], state[i+1]
                new_state = tuple(new_state)
                if new_state not in visited:
                    queue.append((list(new_state), step + 1))
                    visited.add(new_state)
    return -1

