import sys
from typing import List, Tuple

def read_input() -> Tuple[int, int, List[Tuple[int, int, int]]]:
    N, Q = map(int, sys.stdin.readline().split())
    operations = []
    for _ in range(Q):
        L, R, C = map(int, sys.stdin.readline().split())
        operations.append((L, R, C))
    return N, Q, operations

def find_minimum_spanning_tree_cost(N: int, operations: List[Tuple[int, int, int]]) -> int:
    parent = list(range(N + 1))
    edges = []

    def find(x: int) -> int:
        if parent[x] != x:
            parent[x] = find(parent[x])
        return parent[x]

    def union(x: int, y: int) -> None:
        root_x = find(x)
        root_y = find(y)
        if root_x != root_y:
            parent[root_x] = root_y

    for i, (L, R, C) in enumerate(operations):
        for j in range(L, R + 1):
            edges.append((C, N + i + 1, j))

    edges.sort()

    cost = 0
    for C, u, v in edges:
        if find(u) != find(v):
            union(u, v)
            cost += C

    if any(find(i) != find(1) for i in range(2, N + Q + 1)):
        return -1
    return cost

N, Q, operations = read_input()
print(find_minimum_spanning_tree_cost(N, operations))
