def xor_and_power(a, k, mod):
    res = 0
    for x in a:
        res ^= x
    return pow(res, k, mod)

def solve(n, m, k, a, mod):
    dp = [0] * (m + 1)
    dp[0] = 1
    for x in a:
        ndp = [0] * (m + 1)
        for i in range(m + 1):
            for j in range(m + 1):
                if i + j <= m:
                    ndp[(i + j) % m] += dp[i]
                    ndp[(i + j) % m] %= mod
        dp = ndp
    res = 0
    for i in range(1, m + 1):
        res += dp[i] * xor_and_power(a, k, mod)
        res %= mod
    return res

mod = 998244353
n, m, k = map(int, input().split())
a = list(map(int, input().split()))
print(solve(n, m, k, a, mod))
