import sys

def read_input():
    N = int(input())
    M_G = int(input())
    edges_G = set()
    for _ in range(M_G):
        u, v = map(int, input().split())
        edges_G.add(tuple(sorted((u, v))))

    M_H = int(input())
    edges_H = set()
    for _ in range(M_H):
        a, b = map(int, input().split())
        edges_H.add(tuple(sorted((a, b))))

    costs = []
    for _ in range(N-1):
        costs.extend(list(map(int, input().split())))

    return N, edges_G, edges_H, costs

def is_isomorphic(edges_G, edges_H, perm):
    for u, v in edges_G:
        if tuple(sorted((perm[u-1], perm[v-1]))) not in edges_H:
            return False
    return True

def min_cost(N, edges_G, edges_H, costs):
    min_cost = float('inf')
    for perm in permutations(range(1, N+1)):
        if is_isomorphic(edges_G, edges_H, perm):
            cost = 0
            for i in range(N-1):
                for j in range(i+1, N):
                    if tuple(sorted((i+1, j+1))) not in edges_G:
                        cost += costs[(i*(N-1)) + j - ((i+1)*(i))//2]
            min_cost = min(min_cost, cost)
    return min_cost

def main():
    N, edges_G, edges_H, costs = read_input()
    min_cost = min_cost(N, edges_G, edges_H, costs)
    print(min_cost)

