                new_dp[i] = dp[i]
            if i > p and dp[i - 1] > 0 and v >= dp[i - 1]:
                new_dp[i] += dp[i - 1]
                new_dp[i] %= MOD
        dp = new_dp

    print(sum(dp) % MOD)

