def power_mod(x, y, mod):
    res = 1
    while y > 0:
        if y % 2 == 1:
            res = (res * x) % mod
        x = (x * x) % mod
        y //= 2
    return res

def comb_mod(n, k, mod):
    if k > n - k:
        k = n - k
    res = 1
    for i in range(1, k + 1):
        res = (res * (n - i + 1)) % mod
        res = (res * power_mod(i, mod - 2, mod)) % mod
    return res

